import React from 'react';
import './Buttons.css';
import { Link } from 'react-router-dom';

export function Button1(){
    return (
        <Link to='sign-in'>
            <button className='btn'> Sign In</button>
        </Link>
    )
}

export function Button2() {
  return (
    <Link to="sign-up">
      <button className="btn"> Sign In</button>
    </Link>
  );
}
